webpackJsonp([0x5dc0711a4d19],{4836:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Edit His Page",date:"14 Feb 2000",slug:"/2000-02-14-edit-his-page/",tags:"Y2000"},html:'<p>It\'s Valentine\'s Day. Mama and I just remembered... we first noticed each another 20 years ago today! (Actually, it was the first or second weekend in February 1980, which would be the 3rd or the 10th. But Valentine\'s Day is easier to remember.) It was a gathering of <a href="http://www.afs.org">AFS</a> exchange students. I had just returned from Brazil, she was spending a year in Minnesota.</p>\n<p>Wired: <a href="http://www.wired.com/news/business/0,1367,34308,00.html"><br />\nNet Liberation Day in Germany</a> "\'More use means more e-commerce\'... And Schr√∂der believes more e-commerce will mean more jobs." </p>\n<p>Thanks to the lack of material and baby pictures lately, I\'m starting to fall in the ETP <a href="http://www.editthispage.com/Top100">Top 100</a> <i>It\'s about time!</i></p>\n<p>On the other hand, <a href="http://Mama.editthispage.com">Mama</a> is starting to gain self-confidence. She mailed me at work:<br />\n"Hey, I\'m starting to get good at this...." <i>It\'s the magic of being able to Edit This Page!</i></p>\n<p>Suggestion to Userland: How about reserving the domain \'edithispage.com\' (with only one t). That\'s how I always mistype it. ";->" <i>Edit His Page? Isn\'t that sexist?</i></p>\n<p><a href="http://spicynoodles.com">Spicy Noodles</a>: "<a href="http://www.fool.com">The Motley Fool</a> opens <a href="http://www.fool.de">Motley Fool Germany</a>. <i>Cool!</i>" Super cool!</p>'},next:{fields:{title:"Sunday",date:"13 Feb 2000",slug:"/2000-02-13-sunday/"}},previous:{fields:{title:"",date:"15 Feb 2000",slug:"/2000-02-15-jokes-on-yoe/"}}},{node:{fields:{title:"Sunday",date:"13 Feb 2000",slug:"/2000-02-13-sunday/",tags:"Y2000"},html:'<p>Christopher pictures: We took an entire <a href="http://albums.photopoint.com/j/ViewPhoto?u=185392&a=1816050&p=16358198">sequence</a> of pictures during a diaper change. For hard core Christopher fans only!</p>\n<p>Yahoo/Reuters: <a href="http://dailynews.yahoo.com/h/nm/20000213/ts/people_schulz_3.html">\'Peanuts\' Creator Charles M. Schulz Dead at 77</a></p>\n<p>CNNSI: <a href="http://cnnsi.com/soccer/world/news/2000/02/13/german_roundup_ap/">Goalie Butt sets record in Hamburg win</a> He both scored and stopped a penalty</p>'},next:{fields:{title:"Saturday Visitors",date:"12 Feb 2000",slug:"/2000-02-12-saturday-visitors/"}},previous:{fields:{title:"Edit His Page",date:"14 Feb 2000",slug:"/2000-02-14-edit-his-page/"}}},{node:{fields:{title:"Saturday Visitors",date:"12 Feb 2000",slug:"/2000-02-12-saturday-visitors/",tags:"Y2000"},html:'<p>Christopher received visitors today.</p>\n<p>The first was a surprise. Hermann from the farmplace across the road stopped by. He originally owned the land where our house now stands. </p>\n<p>In the evening 2 friends of Mama\'s came by for <a href="http://shanson.editthispage.com/1999/12/24#raclette">raclette</a>. Christopher was the perfect host. He slept during our meal, and politely took his meal later.</p>\n<p>Christopher Photos: <a href="http://albums.photopoint.com/j/AlbumIndex?u=185392&a=1816050">Week 7</a> is now online</p>\n<p><a href="http://www.geocities.com/SiliconValley/Bay/6986/yahoobsd.htm">Why Yahoo uses FreeBSD</a> I just got the 3.4 CDs to try out. <i>Follow up: it worked... I\'m posting this under FreeBSD.</i></p>\n<p>Today\'s <a href="http://www.abendblatt.de">Hamburger Abendblatt</a>, citing Psychologie Heute: The Exotic Germans "During his visit to Germany, Flavien Ndonko from Uganda was shocked to see a woman kissing a dog." <i>I can\'t even find a German link to this story, though, much less an English one!</i></p>'},next:{fields:{title:"Friday",date:"11 Feb 2000",slug:"/2000-02-11-friday/"}},previous:{fields:{title:"Sunday",date:"13 Feb 2000",slug:"/2000-02-13-sunday/"}}}],pathPrefix:"",first:!1,last:!1,index:1080,pageCount:1101}}}});
